import React from 'react';
import Controls from './Components/Controls'
import QuestionContainer from './Components/QuestionContainer'
import { Button } from 'semantic-ui-react'
import './App.css'

const App = () => {
  return (
    <div className="Main">
      <br />
      <h1>Lutrivia</h1>
      <Controls />
      <QuestionContainer />
    </div>
  );
}

export default App;
